    "Most popular benchmark PassMark is a test suite that performs complex mathematical calculations to determine CPU performance on file compression, encryption and physics-related tasks." => "Самый популярный бенчмарк, PassMark - это тестовый пакет, который выполняет сложные математические расчеты для определения производительности процессора при сжатии файлов, шифровании и выполнении задач, связанных с физикой.",
