    "Maxon's Cinebench R23 SC is a cross-platform test suite for macOs and Windows uses one CPU core, with no hypetrading" => "Cinebench R23 SC от Maxon - это кроссплатформенный тестовый пакет для macOs и Windows, использующий одно ядро процессора, без гипетрейдинга.",
    "Maxon's Cinebench R23 MC is a cross-platform test suite for macOs and Windows using a multi-core and hyperthreading" => 'Cinebench R23 MC от Maxon - это кроссплатформенный тестовый пакет для macOs и Windows, использующий многоядерность и гипертрейдинг.',
