    'Cinebench R20 MC is a high load CPU test for long tasks on a desktop or notebook PC, using a multi-core and hyperthreading' => 'Cinebench R20 MC - это тест процессора с высокой нагрузкой при длительных задач на настольном компьютере или ноутбуке с использованием многоядерного режима и гипертрейдинга.',
    'The Cinebench R15 SC stresses the computing modules of a desktop or laptop computer to their limits and accurately determines the key performance parameters of the hardware' => 'Cinebench R15 SC до предела нагружает вычислительные модули настольного или портативного компьютера и точно определяет ключевые параметры производительности оборудования.',
    'The Cinebench R15 MC stresses the computing modules of a desktop or laptop computer to their limits and accurately determines the key performance parameters of the hardware' => 'Cinebench R15 MC максимально нагружает вычислительные модули настольного или портативного компьютера и точно определяет производительность оборудования в мульти-ядерном режиме.',
    'Geekbench 5 SC is a popular cross-platform performance test for desktop or mobile processors that uses system memory intensively' => 'Geekbench 5 SC - популярный кроссплатформенный тест производительности для настольных или мобильных процессоров, интенсивно использует системную память.',
    'Geekbench 5 MC is a popular cross-platform performance test for desktop or mobile processors that uses system memory intensively' => 'Geekbench 5 MC - популярный кроссплатформенный тест производительности для настольных или мобильных процессоров, интенсивно использует системную память и многопоточность.',
    'Monero hashrate is an estimated numerical value that determines how many hashes are generated by miners, benefiting from the number of cores CPU and memory speed' => 'Хэшрейт Monero - это расчетное числовое значение, определяющее, сколько хэшей генерируют майнеры, в зависимости от количества ядер процессора и скорости памяти.',
    'The performance of the iGPU - the internal GPU in games' => 'Производительность iGPU - внутреннего графического процессора в играх. GFLOPS указывает на количество миллиардов операций в секунду, которые способен выполнять iGPU.',
    'The AnTuTu 8 Benchmark tests ARM processors by simulating browser and application performance for Android, iOS, AI, SoC' => 'AnTuTu 8 Benchmark тестирует процессоры ARM, моделируя производительность браузера и приложений для Android, iOS, AI, SoC.',
    'Blender is Open Source Software, creating predefined 3D scenes and measuring the time to execute them' => 'Blender - программное обеспечение с открытым исходным кодом, создающее предопределенные 3D-сцены и измеряющее время их выполнения.',
    'Geekbench 3 SC for one CPU core, includes stress tests simulating real 3D scenarios for Windows, Mac, Linux, Ansroid, iOS' => 'Geekbench 3 SC - бенчмарк для одного ядра процессора, включает стресс-тесты, имитирующие реальные 3D-сценарии для Windows, Mac, Linux, Ansroid, iOS',
    'Geekbench 3 MC using a multi-core and hyperthreading, includes stress tests simulating real 3D scenarios for Windows, Mac, Linux, Ansroid, iOS' => 'Geekbench 3 MC с использованием многоядерности и гипертрейдинга, включает стресс-тесты, имитирующие реальные 3D-сценарии для Windows, Mac, Linux, Ansroid, iOS',
    'The PC CPU and GPU test involves rendering a specific 3D scene in single-core mode, based on CINEMA 4D' => 'Тест CPU и GPU ПК включает рендеринг определенной 3D-сцены в одноядерном режиме на основе CINEMA 4D.',
    'The PC CPU and GPU test involves rendering a specific 3D scene in multi-core mode and hyperthreading, based on CINEMA 4D' => 'Тест CPU и GPU ПК включает рендеринг определенной 3D-сцены в режиме multi-core и гипертрейдинга на базе CINEMA 4D.',
