    'PassMark is a test suite that performs complex mathematical calculations to determine CPU performance on file compression, encryption and physics-related tasks' => 'PassMark - это тестовый пакет, который выполняет сложные математические расчеты для определения производительности процессора при сжатии файлов, шифровании и выполнении задач, связанных с физикой.',
    'Benchmark FP32 is a 32-bit floating point calculation for the GPU which is required for 3D gaming' => 'Бенчмарк FP32 - 32-битные вычисления с плавающей запятой для GPU, которые необходимы для 3D-игр.',
    '3DMark is designed for gamers, overclockers and system builders who want to get the most out of their hardware' => '3DMark предназначен для геймеров, оверклокеров и сборщиков систем, которые хотят получить максимальную отдачу от своего оборудования.',
    'Battlefield 5 is a realistic game, with a built-in benchmark, very suitable as a test for graphics cards' => 'Battlefield 5 - реалистичная игра, со встроенным бенчмарком, очень подходящим в качестве теста для видеокарт.',
