    'The Autolykos algorithm, on which Ergo cryptocurrency is based, allows not only modern GPUs to be used for mining, but also the past generation of GPUs' => 'Алгоритм Autolykos, на котором основана криптовалюта Ergo, позволяет использовать для майнинга не только современные графические процессоры, но и GPU прошлого поколения.',
    'Hashrate mining Ravencoin cryptocurrency on the KawPoW algorithm is fastest on modern video cards' => 'Хэшрейт блокчейна криптовалюты Ravencoin на алгоритме KawPoW быстрее всего на современных видеокартах',
